import React from 'react';
import './Registration.css';
import logo from '../../assets/alconesy_logo.webp';

const Registration = () => {
  return (
    <div className='registration_1'>
      <div className='reg1_form_container'>
        <div className='reg_heading_container'>
          <p className='reg_heading'></p>
        </div>
        <div className='reg_description'>

        </div>
        <div className='reg_form'>

        </div>
      </div>
      <div className='reg1_img_container'>
        <img src={logo} alt="Alconesy Logo" />
      </div>
    </div>
  )
};
export default Registration;
